import React from "react";
import { Button, Link, Title } from "../../single";
import "./Header.css";

const Header = () => {
  return (
    <nav className="Header-comp">
      <Title children={"Buzz Project"} />
      <Link children={"testing"} to="/" />
      <Link children={"Post"} to="/post" />
      <Button
        children={"Click Here `"}
        type={"button"}
        onClickEvent={() => null}
      />
    </nav>
  );
};

export default Header;
